-- 1. Import des communes de la région Nouvelle-Aquitaine

-- 2. Les liens avec les départements ex: "Gironde (33)" => "Pessac (33600)""
--                                                  ^^---------------^^
SELECT p.id, c.id
FROM perimeters c
inner join perimeters p
on p.id = (select p2.id from perimeters p2 where substring(p2.name,1,2) = substring(c.name, -6, 2) limit 1)
where c.type = 'Commune';

